  return (
    <>
      <div className='review-title'>
        <h2>Our Reviews</h2>
      </div>
      <div className='review-row'>
        <Review />
        <ReviewAviyonik />
        <ReviewYazilim />
        <ReviewAviyonik />
        <ReviewYazilim />
      </div>
    </>
  )
}

export default About
